(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["party"],{"1df0":function(n,t,s){"use strict";s.r(t);var p=function(){var n=this,t=n.$createElement,s=n._self._c||t;return s("router-view")},e=[],i={name:"PartyIndex"},a=i,b=s("2877"),r=Object(b["a"])(a,p,e,!1,null,null,null);t["default"]=r.exports},"4a3c":function(n,t,s){"use strict";s.r(t);var p=function(){var n=this,t=n.$createElement,s=n._self._c||t;return s("div",{staticClass:"party",staticStyle:{"padding-top":"30px"}},[s("div",{staticClass:"container"},[s("div",{staticClass:"row body"},[s("div",{staticClass:"row party-name",domProps:{textContent:n._s(n.item.title)}}),s("div",{staticClass:"row"},[s("a-divider")],1)]),s("p",{staticStyle:{color:"#333","line-height":"28px"},domProps:{innerHTML:n._s(n.item.content)}})]),s("div",{staticClass:"divide",staticStyle:{height:"44px"}})])},e=[],i={name:"unionDetail",data:function(){return{item:{title:"翌智航携手行业伙伴建立无人智能物流发展联盟",content:'<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2020年9月16日线上智博会期间&nbsp;，聚焦数字产业化、产业数字化，无人平台智能化应用峰会在渝成功举行。会前，全国首家无人智能物流发展联盟在渝正式签约成立。随后，国内知名专家、学者、企业家代表围绕无人平台在智能产品、智能制造、智能应用、智能技术等领域的前沿技术热点问题，深入探讨无人平台发展趋势、市场需求、技术成果、产业环境等。</p><p><img alt="union.png"src="https://i.loli.net/2021/01/07/2qDvFifEhzsOx9R.png"/></p><p style="text-align:center">无人智能物流发展联盟正式成立</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;此次无人智能物流发展联盟由重庆市高新技术产业开发区管委会、西永微电子产业园区和中国国际智能产业博览会组委会联合中电科翌智航（重庆）科技有限公司举办。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;会上，深圳丰朗供应链有限公司、中国电科云科技有限公司、中国平安财产保险股份有限公司、重庆交通大学、华创智能科技研究院、重庆驼航科技有限公司、重庆自行者科技有限公司、拓树（重庆）通用航空有限公司、深圳市科卫泰实业发展有限公司、西安羚控电子科技有限公司、西北工业大学、江西翱翔星云科技有限公司、珠海隆华直升机科技有限公司、北京航空航天大学、北京通用航空江西直升机有限公司、哈工大机器人集团北京科安智博科技发展有限公司、中国航天十二院北京航天兴科高新技术有限公司等单位的与会代表做大会交流，重点介绍了无人平台智能化未来发展的趋势，如集群化、实现全程&ldquo;在线&rdquo;作业的通信链路、真无人化的自动机场，基于物联网的数字孪生等先进技术，以及对未来发展生态的展望。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;北京通用航空江西直升机有限公司、深圳丰朗供应链有限公司、深圳科卫泰实业发展有限公司等多家无人机厂商负责人在峰会上对其产品接入翌智航公司无人平台智能管控系统后，在各类项目和实验中的应用进行了说明展示。比如，抗疫期间对其运投任务的调配，多型无人机接入统一管控，无死角立体巡查等方面的赋能。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;中电科翌智航（重庆）科技有限公司研发总监支晓栋表示，近两年无人机物流产业已经在零星发展，但是由于物流产业链非常长，很多企业各自为战，产业发展比较零散化。此次成立无人智能物流发展联盟，就是要把大家聚集在一起，整合资源，实现业务共享、信息共享，促进无人物流落地发展、规模化应用，并形成无人物流相关的行业标准。</p>'}}}},a=i,b=(s("c355"),s("2877")),r=Object(b["a"])(a,p,e,!1,null,"61227edb",null);t["default"]=r.exports},ae9d:function(n,t,s){},c355:function(n,t,s){"use strict";var p=s("ae9d"),e=s.n(p);e.a}}]);
